import { Backdrop, Box, Button, CircularProgress, Container, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from "@mui/material";
import { DashboardLayout } from "../dashboard/dashboard-layout";
import React, { useState } from "react";
import AddIcon from "@mui/icons-material/Add";
import { useNavigate } from "react-router-dom";
import routes_service from "../../services/routes_service";

const Upload = () => {
  const navigate = useNavigate();

  const [selectedFiles, setSelectedFiles] = useState(undefined);
  const [message, setMessage] = useState([]);
  const [summary, setSummary] = useState([]);
  const [fileName, setFileName] = useState("");
  const [loadingGtfs, setLoadingGtfs] = useState(false);

  const selectFile = (event) => {
    setSelectedFiles(event.target.files);
    setFileName(event.target.files[0].name);
  };

  const upload = () => {
    setMessage([]);
    setLoadingGtfs(true);
    let currentFile = selectedFiles[0];
    setSelectedFiles(undefined);
    routes_service.createZip(currentFile)
      .then((response) => {
        setLoadingGtfs(false);
        console.log(response)
        if (response.data) {
          setMessage(response.data.notices)
          setSummary(response.data.summary)
          console.log(response.data.summary)
          console.log(response.data.notices)
        }
      })
      .catch((error) => {
        setMessage(error.status);
      });
  };

  const handleClose = () => {
    setLoadingGtfs(false);
  };


  const [selectedRow, setSelectedRow] = useState(null);
  const [selectedHeaders, setSelectedHeaders] = useState([]);

  function messageE() {
    const handleRowClick = (index) => {
      if (selectedRow === index) {
        setSelectedRow(null);
        setSelectedHeaders([]);
      } else {
        setSelectedRow(index);
        setSelectedHeaders(Object.keys(message[index].sampleNotices[0]));
      }
    };

    return (
      <div>
        {summary ? (
          <div>
            <TableContainer>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Agencies included</TableCell>
                    <TableCell>Files included</TableCell>
                    <TableCell>Counts</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {summary.agencies.map((item, index) => (
                    <TableRow key={index}>
                      <TableCell>{item.name}</TableCell>

                    </TableRow>
                  ))

                  }
                </TableBody>
              </Table>
            </TableContainer>
          </div>
        ) : (
          <div>No messages to display.</div>
        )
        }
        {message && message.length > 0 ? (
          <TableContainer component={Paper}>
            <Table sx={{ minWidth: 650 }}>
              <TableHead>
                <TableRow>
                  <TableCell>NOTICE CODE</TableCell>
                  <TableCell>SEVERITY</TableCell>
                  <TableCell>TOTAL NOTICES</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {message.map((item, index) => (
                  <React.Fragment key={index}>
                    <TableRow hover onClick={() => handleRowClick(index)}>
                      <TableCell>
                        {selectedRow === index ? "-" : "+"} {item.code}
                      </TableCell>
                      <TableCell>
                        {item.severity === "ERROR" ? (
                          <span style={{ color: "red" }}>ðŸ”´ </span>
                        ) : item.severity === "WARNING" ? (
                          <span style={{ color: "orange" }}>ðŸŸ  </span>
                        ) : (
                          <span style={{ color: "gray" }}>âšª </span>
                        )}
                        {item.severity}
                      </TableCell>
                      <TableCell>{item.totalNotices}</TableCell>
                    </TableRow>
                    {selectedRow === index && (
                      <TableRow>
                        <TableCell colSpan={3}>
                          <TableContainer component={Paper}>
                            <p>{item?.description}</p>
                            <br />
                            <p>{item?.shortSummary}</p>
                            <br />
                            <p>
                              You can see more about this notice{" "}
                              <a
                                href={item?.url}
                                target="_blank"
                                rel="noreferrer"
                              >
                                here
                              </a>
                            </p>
                            <br />
                            <Table >
                              <TableHead>
                                <TableRow>
                                  {selectedHeaders.map((header, index) => (
                                    <TableCell key={index}>{header}</TableCell>
                                  ))}
                                </TableRow>
                              </TableHead>
                              <TableBody>
                                {item.sampleNotices.map((notice, i) => (
                                  <TableRow key={i}>
                                    {selectedHeaders.map((header, index) => (
                                      <TableCell key={index}>
                                        {notice[header]}
                                      </TableCell>
                                    ))}
                                  </TableRow>
                                ))}
                              </TableBody>
                            </Table>
                          </TableContainer>
                        </TableCell>
                      </TableRow>
                    )}
                  </React.Fragment>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        ) : (
          <div>No messages to display.</div>
        )}
      </div>
    );
  }

  return (
    <DashboardLayout>
      <Box component="main" sx={{ flexGrow: 1, py: 8 }}>
        <Container maxWidth={false}>
          <div>
            <Button variant="contained" component="label" color="primary">
              {" "}
              <AddIcon /> Selecciona un GTFS
              <input
                type="file"
                hidden
                onChange={selectFile}
                accept="file/zip"
              />
            </Button>
            <Button
              className="btn btn-success"
              disabled={!selectedFiles}
              onClick={upload}
              sx={{ m: 1 }}
            >
              ValidaciÃ³n GTFS
            </Button>

            <div>{messageE()}</div>
            {/* {fileName} */}
          </div>
        </Container>
      </Box>
      <Backdrop
        sx={{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer + 1 }}
        open={loadingGtfs}
        onClick={handleClose}
      >
        <CircularProgress color="inherit" />
      </Backdrop>
    </DashboardLayout>
  );
};

export default Upload;
